import React from "react";
import styles from "./HeaderCart.module.css";

const HeaderCart = () => {

  return (
    <>
      <button type='button' className={styles["button"]}><i src={require("../images/shopping-cart-solid.svg")} className={styles.icon}></i>Your Cart</button>
    </>
  );
};

export default HeaderCart;
